import React , { useState } from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Container,
  Jumbotron,
  Form,
  FormGroup,
  Label,
  Input,
  Button,
  Alert
} from 'reactstrap';


function Home() {


   

    const [isOpen, setIsOpen] = useState(false);
    const toggle = () => setIsOpen(!isOpen);

  return (
        <div>
            <Navbar color="dark" dark expand="md" className='pg-nav'>
            
            <Container>
        <NavbarBrand  href="/">Henri Michel</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="mr-auto" navbar>
            <NavItem>
              <NavLink href="/orcamento">Orçamento</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="https://github.com/henri-miche">GitHub</NavLink>
            </NavItem>
          </Nav>
        </Collapse>
        </Container>
      </Navbar>

      <Jumbotron className='pg-home'>
      <style>
          {`.pg-home{
              background-color: #000;
              color:  #FFA500;
              padding-top:50px;
              padding-bottom:50px;
              margin-bottom:0rem !important;
         }`}
      </style>
        <Container >
          <h1 className="display-4 text-center">Nossos consultores estão prontos para lhe ajudar!</h1>
          <p className="lead text-center mb-4">Deixe seus contatos abaixo que retornaremos com a proposta específica para sua necessidade.</p>
        
        
        
        </Container>
      </Jumbotron>

         <Jumbotron fluid className="rodape bg-dark">
         <style>
             {`.rodape{
                 color:#fff;
                 padding-top:10px;
                 padding-bottom:10px;
                 margin-bottom:0rem !important;
             }`}
         </style>
             <Container>
                <h1 className="lead text-center">Rodapé</h1>
             </Container>
         </Jumbotron>
      
        </div>
  
  );
}

export default Home;
